import './App.css';
import React from "react";
import './App.css'
import 'antd/dist/antd.css'
import './index.css'
import InputBox from './component/Input'
import {Button, PageHeader} from "antd";
import OutputBox from "./component/output";
import RadioBox from "./component/Radio";
import PersonLists from "./component/AnalyzeButton";
import FormBox from "./component/AnalyzerForm";
import AnalyzerForm from "./component/AnalyzerForm";
import TestApp from "./component/nreForm";






function App() {
  return (
    <div className="App">
      <div>
          <div className="App-header">
              <PageHeader>
                  <div className="Header-Name">
                      Content Analyzer
                  </div>
              </PageHeader>
          </div>


          <div className="ContentBox">

              <div className="Inbox">
                  <AnalyzerForm/>
              </div>

              <div className="Outbox">
                  <OutputBox/>
              </div>
          </div>

          <footer className="footer">
              <div className="Analyze-Button">
                  <Button>Analyze</Button>
              </div>

          </footer>

      </div>

    </div>
  );

}

export default App;
